import UIKit
import SpriteKit
import AVFoundation

class MainVC: UIViewController {
    //控制發射例子
    let emitterNode = SKEmitterNode(fileNamed: "MySnowParticle")
    //avplayer
    let avPlayer = AVPlayer()
    
    @IBOutlet weak var speakButton: UIButton!
    @IBOutlet weak var snowButton: UIButton!
    override func viewDidLoad() {
        super.viewDidLoad()
        
        let skView = SKView(frame: view.frame)
        let scene = SKScene(size: skView.frame.size)
        
        view.insertSubview(skView, at: 0)
        
        
        scene.anchorPoint = CGPoint(x: 0.5, y: 1)
        //允許透明
        skView.allowsTransparency = true
        //設定背景透明
        scene.backgroundColor = UIColor.clear
        emitterNode?.particleBirthRate = 40
        scene.addChild(emitterNode!)
        skView.presentScene(scene)
        
        setGradient()
        showOlaf()
    }
    
    //說話
    @IBAction func speak(_ sender: Any) {
        
        if avPlayer.timeControlStatus == .playing {
            avPlayer.pause()
            speakButton.setTitle("說話", for: .normal)
        }else{
            
            let url = Bundle.main.url(forResource: "Olaf Speak", withExtension: "m4a")
            let playerItem = AVPlayerItem(url: url!)
            avPlayer.replaceCurrentItem(with: playerItem)
            avPlayer.play()
            speakButton.setTitle("停止說話", for: .normal)

        }
    }
    
    //下雪
    @IBAction func snow(_ sender: Any) {
        if emitterNode?.particleBirthRate == 0 {
            emitterNode?.particleBirthRate = 40
            snowButton.setTitle("停止下雪", for: .normal)
        }else{
            emitterNode?.particleBirthRate = 0
            snowButton.setTitle("下雪", for: .normal)
        }
    }
    
    //漸層
    func setGradient() {
        let gradientLayer = CAGradientLayer()
        gradientLayer.frame = view.frame
        gradientLayer.colors = [UIColor(red: 104/255, green: 213/255, blue: 255/255, alpha: 1).cgColor , UIColor.white.cgColor]
        
        //漸層方向
        gradientLayer.startPoint = CGPoint(x: 0, y: 0.5)
        gradientLayer.endPoint = CGPoint(x: 1, y: 0.5)
        //顏色比例
//        gradientLayer.locations = [0 , 0.5]
        
        view.layer.insertSublayer(gradientLayer, at: 0)
//                self.view.layer.addSublayer(gradientLayer) //會後蓋前
        
    }
    
